import { Component } from "react";

export default class Artist extends Component{
    constructor(props){
        super(props);
        this.state = {
            isLoaded: false,
            artists: {
                _embedded: {
                    artistList:[]
                },
                _links:{
                    self: {}
                }
            }
        };
    }
    componentDidMount(){
        fetch("/api/songcollection/artists")
        .then(res => res.json())
        .then(
            (result) => {
                this.setState({
                    isLoaded: true,
                    artists: result._embedded
                })
            }
        ) 
    }
    render(){
        const {isLoaded, artists} = this.state
        if(!isLoaded){
            return <div>Loading...</div>
        }else if( typeof(artists)!== 'undefined'){
            return (
            // <ul>
            // {artists.map(artist => (
            //     <li key={artist.uuid}>
            //     {artist.name} {artist.active}
            //     </li>
            // ))}
            // </ul>
            artists.isLoaded
            )
        }


    }
}
